"use strict"

import { StyleSheet, Text, View } from "react-native";

const Data = () => {
    return (
        <View style={styles.container} >
        </View>
    )

}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        flexDirection: 'row',
        justifyContent: 'space-evenly',
        alignItems: 'center',
        marginBottom: 10,
    }
})

export default Data;
